import * as React from 'react';
import $ from 'jquery'; 
import PropTypes from 'prop-types';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Typography from '@mui/material/Typography';

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));

const BootstrapDialogTitle = (props) => {
  const { children, onClose, ...other } = props;

  return (
    <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
      {children}
      {onClose ? (
        <IconButton
          variant = "contained"
          aria-label="close"
          onClick={onClose}
          sx={{
            position: 'absolute',
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton> 
      ) : null}
    </DialogTitle>
  );
};

BootstrapDialogTitle.propTypes = {
  children: PropTypes.node,
  onClose: PropTypes.func.isRequired,
};

const PriceCalculate = () =>{
  var valuestart = $("select[name='timestart']").val();
  var valuestop = $("select[name='timestop']").val();

   //create date format          
   var timeStart = new Date("01/01/2007 " + valuestart).getHours();
   var timeEnd = new Date("01/01/2007 " + valuestop).getHours();

   var hourDiff = timeEnd - timeStart;  
   console.log(hourDiff)
}

export default function Exitpage(exitInfo) {
  const [open, setOpen] = React.useState(false);

  let  current = new Date()

console.log(exitInfo.slotInfo.entry_time,"exitInfo",current.toLocaleTimeString(),current.getTime(),current,current.getHours())
  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const Paybutton = () => { 
    alert("payment Done")
  }
  return (

    <div>
      <Button variant="contained" onClick={handleClickOpen}>
        Exit
      </Button>
      <BootstrapDialog
        onClose={open}
        aria-labelledby="customized-dialog-title"
        open={open}
      >
        <BootstrapDialogTitle id="customized-dialog-title" onClose={handleClose}>
          Payment Details
        </BootstrapDialogTitle>
        <DialogContent dividers>
           Paymnet details need to show here !
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={Paybutton}>
            Pay
          </Button>
        </DialogActions>
      </BootstrapDialog>
    </div>
  );
}
